import { Box } from "@material-ui/core";
import { Timeline, TimelineItem } from "@material-ui/";


function WorkHistory() {
    return (
        <Box backgroundColor='red'>
            <Timeline position='alternate'>
                <TimelineItem></TimelineItem>
            </Timeline>
        </Box>
    )
}


export default WorkHistory;
